Leyland, Charles - Aradia, or the Gospel of the witches of Italy, 1899, 147 pages

Leyland's classic text is one of the texts responsible for the development of modern neopagan beliefs and practices. The &quot;Charge of the Goddess&quot; used by many Wiccans, for example, was first found in this work. As one of the formative works of magikal thought, this is a &quot;must read&quot; for those interested in the arcane arts.


